import React from 'react';
import ProductCard from '../components/ProductCard'; // Asegúrate de que la ruta es correcta

const ProductListPage = () => {
  // Datos de ejemplo, reemplázalos con datos reales de productos
  const products = [
    { id: 1, name: 'Planta A', price: 10, image: 'path/to/imageA.jpg', category: 'Interior' },
    { id: 2, name: 'Planta B', price: 15, image: 'path/to/imageB.jpg', category: 'Exterior' },
    { id: 3, name: 'Planta C', price: 20, image: 'path/to/imageC.jpg', category: 'Suculenta' },
    // Añadir más productos
  ];

  return (
    <div>
      <h2>Listado de Productos</h2>
      <div className="product-list">
        {products.map(product => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
};

export default ProductListPage;
